import React from "react";

class Text extends React.Component{
    render() {
        return(
            <div>
                 <div>What kind of stuff you accept?</div>              <div>What do you do with my stuff?</div>
                 <div>We accept everything that can be put</div>        <div>We refurbish old things and sell it to</div>
                 <div>in a small truck inckuding furniture,</div>       <div>the people who cannot afford or don't</div>
                 <div>electronics, clothes and so on.</div>             <div>want to buy brand new stuff</div>
            </div>
        );
     }
}

export default Text;
